(function (cs) {

    "use strict";

    var image108Base64 = "";
    var image109Base64 = "";

    function str2ab(str) {
        var buf = new ArrayBuffer(str.length*2); // 2 bytes for each char
        var bufView = new Uint16Array(buf);
        var index = 0;
        for (var i=0, strLen=str.length; i<strLen; i+=2) {
            var lower = str.charCodeAt(i);
            var upper = str.charCodeAt(i+1);
            bufView[index] = lower + (upper <<8);
            index++;
        }
        return bufView;
    }

    function getPixelData(base64PixelData)
    {
        var pixelDataAsString = window.atob(base64PixelData);
        var pixelData = str2ab(pixelDataAsString);
        return pixelData;
    }

    var image1PixelData = getPixelData(image108Base64);
    var image2PixelData = getPixelData(image109Base64);

    function getExampleImage(imageId) {

        var width = 256;
        var height = 256;

        function getPixelData()
        {
            if(imageId == 'example://1')
            {
                return image1PixelData;
            }
            else if(imageId = 'example://2')
            {
                return image2PixelData;
            }
            throw "unknown imageId";
        }

        var image = {
            imageId: imageId,
            datatype: 'uint8',
            minPixelValue : 0,
            maxPixelValue : 257,
            slope: 1.0,
            intercept: 0,
            windowCenter : 127,
            windowWidth : 256,
            render: cornerstone.renderGrayscaleImageWebGL,
            getPixelData: getPixelData,
            rows: height,
            columns: width,
            height: height,
            width: width,
            color: false,
            columnPixelSpacing: .8984375,
            rowPixelSpacing: .8984375,
            sizeInBytes: width * height * 2
        };

        var deferred = $.Deferred();
        deferred.resolve(image);
        return deferred;
    }


    // register our imageLoader plugin with cornerstone
    cs.registerImageLoader('example', getExampleImage);

}(cornerstone));